import './App.css';
import MainPage from './Pages/MainPage';
function App() {
  return (
    <div className="App w-screen h-screen  overflow-y-auto ">
            <div className="header flex justify-center items-center w-full h-[4vw] bordertest fixed">
                <div className='w-[47.5vw] h-full bordertest flex items-center '></div>
                <div className='w-[47.5vw] h-full bordertest fontRoboto flex'>
                    <div className='w-[34vw] h-full bordertest flex items-center justify-center gap-'>
                        <div className='w-[5vw] h-full bordertest flex justify-center items-center cursor-pointer'>Home</div>
                        <div className='w-[5vw] h-full bordertest flex justify-center items-center cursor-pointer'>About Us</div>
                        <div className='w-[5vw] h-full bordertest flex justify-center items-center cursor-pointer'>Contact Us</div>
                        <div className='w-[5vw] h-full bordertest flex justify-center items-center cursor-pointer'>FAQ</div>
                    </div>
                    <div className='w-[14.5vw] h-full bordertest items-center justify-end flex gap-[0.5vw]'>
                        <div className='w-[6vw] h-[2.75vw] bordertest signup flex justify-center items-center cursor-pointer'>Sign Up</div>
                        <div className='w-[6vw] h-[2.75vw] bordertest bg-black  flex justify-center items-center lgn cursor-pointer'>Log In</div>
                    </div>
                </div>
            </div>
      <MainPage/>
    </div>
  );
}

export default App;
